Like let bindings a case expression can be used to destructure values that contain other values, such as tuples and lists. case xs {
| [] -> "This list is empty"
| [a] -> "This list has 1 element"
| [a, b] -> "This list has 2 element"
| other -> "This list has more than 2 elements"
} It's not just the top level data structure that can be pattern matches, contained values can also be matched. This gives case the ability to concisely express flow control that might be verbose without pattern matching. case xs {
| [[]] -> "The only element is an empty list"
| [[] | _] -> "The 1st element is an empty list"
| [[4] | _] -> "The 1st element is a list of the number 4"
| other -> "Something else"
} case xs {
| {1, _} -> "The 1st element is 1"
| {_, 1} -> "The 2nd element is 1"
| other -> "Something else"
}

