A new record with updated or additional fields can be created using the { record | field_name = value } update syntax. The updated record fields do not have to have the same types as the original fields. let pup = { name = "Rex", size = 40 }
let dog = { pup | size = 70, playful = True } pup // { name = "Rex", size = 40 }
dog // { name = "Rex", size = 70, playful = True }

