Gleam's type system aims to be as permissive when it comes to records passed to functions. Take this function for example. fn get_following_year(record) { record.year + 1
} The type of this function is fn({ a | year = Int }) -> Int . The a | in { a | year = Int} means "any other fields", so this function can be called with any record so long as the record has a year field that has an Int value. let date = { day = 5, month: 1, year = 2019 }
let book = { title = "Sabriel", year = 1995 }
let soup = { kind = "Tomato", spicy = False }
let wine = { kind = "Fancy!", year = "Good" } get_following_year(date) // => 2020
get_following_year(book) // => 1996
get_following_year(soup) // Compile time error! No year field
get_following_year(wine) // Compile time error! Wrong field type

